const initialFValues={
    id:0,
    fullName:'',
    email:'',
    mobile:'',
    city:'',
    gender:'male',
    class:'',
    admittedDate: new Date(),
}




export default function StudentForm (){
    const classes = useStyles();
    const {values,
        setValues, 
         handleInputChange}= UseForm(initialFValues);

    return(
        <Form>
            <Grid container>
                <Grid item xs={6}>
                    <TextField value={values.fullName}  label="Full Name" 
                    variant="outlined" 
                    name='fullName'
                    onChange={handleInputChange}
                    />
                    <TextField value={values.email}  label="E-mail"
                    name="email"
                     variant="outlined" />

                </Grid>
